import React from "react";
import CoinPerCent from "./CoinPerCent";
import CoinPrice from "./CoinPrice";
import CoinVolume from "./CoinVolume";
import Id from "./Id";
import Image from "./Image";
import MarketCap from "./MarketCap";
import Symbol from "./Symbol";

const Coin = (props) => {
  return (
    <>
      <CoinPerCent coinpercent={props.coinpercent} />
      <CoinPrice />
      <CoinVolume />
      <Id />
      <Image />
      <MarketCap />
      <Symbol />
    </>
  );
};

export default Coin;
